import React from 'react';
import { Link } from 'react-router-dom'

function Navigation() {
    const navStyle = {
         color: 'white',
         textDecoration: 'none'
    }
  return (
    <nav className="Navigation">
      <h3>Ready Roofer</h3>
      <ul className="Nav-Links">
          <Link className="" to='/getaquote'>
            <li style={navStyle}>Get A Quote</li>
          </Link>
          <Link to='/about'>
            <li style={navStyle}>About</li>
          </Link>
      </ul>
    </nav>
  );
}

export default Navigation;
